import { Link } from 'react-router-dom';
import "styled-components";

const StyledInput = styled.input`
    width: 200px;
    height: 40px;
    border: solid black 2px;
`;

export const Menu = () => {
  return (
    <div className="header">
      <ul className="menu">
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/profile">Profile</Link>
        </li>
      </ul>
    </div>
  );
};
